	(1, 'Receita', '<p class="ql-align-right"><img src="data:image/png;base64,"></p><p class="ql-align-right"><span style="color: rgb(136, 136, 136);">----------------------------------------------------------------------------------------------</span></p><p class="ql-align-right"><br></p><p class="ql-align-center"><br></p><h3 class="ql-align-center"><strong>Receita</strong></h3><p class="ql-align-center"><br></p><p><span class="ql-font-monospace">Paciente:</span><span style="background-color: transparent; color: rgb(0, 0, 0);" class="ql-font-monospace">&nbsp;</span><strong style="background-color: transparent; color: rgb(0, 0, 0);" class="ql-font-monospace">[[Nome do Paciente?paciente:texto]]</strong></p><p class="ql-align-center"><br></p><p class="ql-align-right"><br></p><p class="ql-align-justify"><span class="ql-font-monospace">[[Medicamento?medicamento:lista=receita]]</span></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify"><span class="ql-font-monospace"> [[Data de Hoje?hoje:data_extenso]]</span></p><p><br></p>', 1, 1, 1, 0, 1680815300),
	(3, 'Atestado', '<p class="ql-align-right"><img src="data:image/png;base64,"></p><p class="ql-align-right"><span style="color: rgb(136, 136, 136);">----------------------------------------------------------------------------------------------</span></p><p class="ql-align-right"><br></p><p class="ql-align-center"><br></p><h3 class="ql-align-center"><strong><u>Atestado</u></strong></h3><p class="ql-align-center"><br></p><p class="ql-align-center"><br></p><p class="ql-align-right"><br></p><p class="ql-align-right"><br></p><p class="ql-align-right"><br></p><p class="ql-align-center"><br></p><p class="ql-align-center"><br></p><p class="ql-align-center"><br></p><p class="ql-align-justify">	Atestamos para os devidos fins, que o paciente [[Nome do Paciente?paciente:texto]] esteve em consulta no [[O dia de Hoje?dia:dia]] pela [[Período?periodo:escolha=manhã,tarde]].</p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p><br></p><p class="ql-align-justify">&nbsp;[[Data de Hoje?hoje:data_extenso]]</p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p>', 1, 0, 0, 1658863122, 1680815656),
	(6, 'Exames', '<p class="ql-align-right"><img src="data:image/png;base64,"></p><p class="ql-align-right"><span style="color: rgb(136, 136, 136);">----------------------------------------------------------------------------------------------</span></p><p class="ql-align-right"><br></p><p class="ql-align-center"><br></p><h4 class="ql-align-center"><strong><u>Exames Complementares</u></strong></h4><p class="ql-align-center"><br></p><p><br></p><p>Paciente:<span style="background-color: transparent; color: rgb(0, 0, 0);">&nbsp;</span><strong style="background-color: transparent; color: rgb(0, 0, 0);">[[Nome do Paciente?paciente:texto]]</strong></p><p class="ql-align-right"><br></p><p class="ql-align-right"><br></p><p class="ql-align-right"><br></p><h3 class="ql-align-justify"><strong class="ql-font-monospace">Solicito:</strong><span class="ql-font-monospace">	</span></h3><p class="ql-align-justify"><br></p><p class="ql-align-justify"><span class="ql-font-monospace">[[Exame?exame:lista=exame]]</span></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify"><span class="ql-font-monospace"> [[Data de Hoje?hoje:data]]</span></p>', 1, 0, 0, 1660085579, 1680815170),
	(7, 'Consulta', '<h3 class="ql-align-center"><strong style="background-color: transparent; color: rgb(0, 0, 0);">1º CONSULTA:&nbsp;</strong></h3><h3 class="ql-align-center"><strong style="background-color: transparent; color: rgb(0, 0, 0);">CONSULTA SEGUIMENTO: [[Data de Hoje?hoje:data]]</strong></h3><p><span style="background-color: transparent; color: rgb(0, 0, 0);">NOME:&nbsp;</span><strong style="background-color: transparent; color: rgb(0, 0, 0);">[[Nome do Paciente?paciente:texto]]</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">DATA DE NASCIMENTO:&nbsp;</span><strong style="background-color: transparent; color: rgb(0, 0, 0);">[[Data de Nascimento?nascimento:data]]</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">DATA:&nbsp;</span><strong style="background-color: transparent; color: rgb(0, 0, 0);">[[Data de Hoje?hoje:data]]</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">IDADE:&nbsp;</span><strong style="background-color: transparent; color: rgb(0, 0, 0);">[[Idade do Paciente?idade:texto]]</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">NOME DOS PAIS:&nbsp;</span><strong style="background-color: transparent; color: rgb(0, 0, 0);">[[Acompanhante?acompanhante:texto]]</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">ENDEREÇO:&nbsp;</span><strong style="background-color: transparent; color: rgb(0, 0, 0);">[[Endereço?endereco:texto]]</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">SEXO: </span><strong style="background-color: transparent; color: rgb(0, 0, 0);">[[Sexo ?sexo:escolha=sim,não]]</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">PROCEDÊNCIA: </span><strong style="background-color: transparent; color: rgb(0, 0, 0);">[[Procedência ?procedencia:texto]]</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">PROCEDÊNCIA:&nbsp;</span></p><p><br></p><ol><li><strong style="background-color: transparent;">QPD:&nbsp;</strong></li></ol><p><br></p><ol><li><strong style="background-color: transparent;">HMA:&nbsp;</strong></li></ol><p><br></p><p><br></p><ol><li><strong style="background-color: transparent;">HISTÓRIA PATOLÓGICA PREGRESSA</strong></li></ol><p><br></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">DOENÇAS ANTERIORES:&nbsp;</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">CIRURGIAS:&nbsp; &nbsp; &nbsp; &nbsp; / INTERNAÇÕES: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; / ALERGIAS:&nbsp;</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">MEDICAÇÃO CONTÍNUA:&nbsp;</span></p><p><br></p><ol><li><strong style="background-color: transparent;">HISTÓRIA FISIOLÓGICA:</strong></li></ol><p><span style="background-color: transparent; color: rgb(0, 0, 0);">APETITE:&nbsp;</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">SONO:&nbsp;&nbsp;</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">RITMO INTESTINAL:&nbsp;</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">FUNÇÃO URINÁRIA/DESFRALDE:&nbsp;</span></p><p><br></p><ol><li><strong style="background-color: transparent;">HISTÓRIA GESTACIONAL</strong></li></ol><p><br></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">IDADE MATERNA:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; / GPA &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; / IG:&nbsp;</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">APGAR: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; / GS RN&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; / GS MÃE&nbsp;</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">Peso ao nascer: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; estatura:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p><ol><li><strong style="background-color: transparent;">TRIAGENS NEONATAIS:&nbsp;</strong></li></ol><p><br></p><ol><li><strong style="background-color: transparent;">ALIMENTAÇÃO:&nbsp;</strong></li></ol><p><br></p><p><br></p><ol><li><strong style="background-color: transparent;">VACINAÇÃO:&nbsp;</strong></li></ol><p><br></p><ol><li><strong style="background-color: transparent;">DNPM:&nbsp;</strong></li></ol><p><br></p><ol><li><strong style="background-color: transparent;">HISTÓRIA FAMILIAR</strong></li></ol><p><br></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">MÃE:&nbsp;</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">PAI:&nbsp;</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">IRMÃOS:&nbsp;</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">OUTROS:&nbsp;</span></p><p><br></p><ol><li><strong style="background-color: transparent;">EXAME FÍSICO</strong></li></ol><p><span style="background-color: transparent; color: rgb(0, 0, 0);">FC:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; FR: &nbsp; &nbsp; SatO2: &nbsp; &nbsp; Temp:</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">Geral: BEG, normocorado, hidratado, acianótico, afebril</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">ACV: BRNF em 2 tempos sem sopros</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">AR: MV+ em ambos HT sem RA</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">Abdome: plano, flácido, indolor à palpação, ausência de massas e VMG</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">GU: típica masculina para sexo e idade, testículos palpáveis</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">Extremidades: bem perfundidas, sem edema, TEC&lt;2s</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">Neurológico: ativo, reativo, sem sinais de meninginismo, ampla movimentação dos 4 membros</span></p><p><br></p><ol><li><strong style="background-color: transparent;">EXAMES COMPLEMENTARES</strong></li></ol><p><br></p><p><br></p><ol><li><strong style="background-color: transparent;">HIPÓTESE DIAGNÓSTICA</strong></li></ol><p><br></p><p><br></p><p><br></p><ol><li><strong style="background-color: transparent;">CONDUTAS:</strong></li></ol><p><br></p>', 1, 0, 0, 1661885763, 1679662383),
	(8, 'Anaminese', '<h2 class="ql-align-center"><strong><u>Consulta</u></strong></h2><p class="ql-align-center"><br></p><p><strong>Anaminese:</strong></p><ol><li>Tem&nbsp;<strong>Febre?&nbsp;</strong>&nbsp;[[Tem febre?febre:escolha=Sim,Não]]</li><li><strong>Diarréia?&nbsp;</strong>&nbsp;Sim&nbsp;&nbsp;Não</li><li>Já esteve&nbsp;<strong>Internado?</strong>&nbsp;&nbsp;Sim&nbsp;&nbsp;Não</li><li>Sintoma de&nbsp;<strong>Gripe?</strong>&nbsp;&nbsp;Sim&nbsp;&nbsp;Não</li><li><strong>Idade :&nbsp;</strong></li><li><strong>Fim</strong></li></ol><p><br></p><p><br></p><p><br></p>', 1, 0, 0, 1678901705, 1678901782),
	(10, 'exames_1ano', '<p class="ql-align-right"><img src="data:image/png;base64,"></p><p class="ql-align-right"><span style="color: rgb(136, 136, 136);">----------------------------------------------------------------------------------------------</span></p><p class="ql-align-right"><br></p><p class="ql-align-center"><br></p><h4 class="ql-align-center"><strong><u>Exames Complementares</u></strong></h4><p class="ql-align-center"><br></p><p>Paciente:<span style="color: rgb(0, 0, 0); background-color: transparent;">&nbsp;</span><strong style="color: rgb(0, 0, 0); background-color: transparent;">[[Nome do Paciente?paciente:texto]]</strong></p><p><br></p><p class="ql-align-right"><br></p><p class="ql-align-right"><br></p><p class="ql-align-right"><br></p><h3 class="ql-align-justify"><strong>Solicito:</strong>	</h3><p class="ql-align-justify"><br></p><ul><li class="ql-align-justify">Hemograma completo</li><li class="ql-align-justify">Glicemia de jejum</li><li class="ql-align-justify">25 OAH vitamina D</li><li class="ql-align-justify">Vitamina B12</li><li class="ql-align-justify">Ureia </li><li class="ql-align-justify">Creatinina</li><li class="ql-align-justify">TSH</li><li class="ql-align-justify">T4 livre</li><li class="ql-align-justify">Sumário de urina</li><li class="ql-align-justify">Parasitológico de fezes 01 amostra</li></ul><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-indent-3 ql-align-justify"><br></p><p class="ql-indent-3 ql-align-justify"><br></p><p class="ql-indent-3 ql-align-justify"><br></p><p class="ql-indent-3 ql-align-justify"><br></p><p class="ql-indent-3 ql-align-justify"><br></p><p class="ql-align-justify"> [[Data de Hoje?hoje:data_extenso]]</p><p><br></p>', 1, 0, 0, 1680813121, 1680813614);

