INSERT INTO `nota` (`id`, `nome`, `tipo_nota`, `conteudo`, `atendimento_id`, `cor_id`, `etiqueta_id`, `criado_em`, `alterado_em`, `estado`) VALUES
	(34, 'exames_1ano', 1, '<p class="ql-align-right"><img src="data:image/png;base64,"></p><p class="ql-align-right"><span style="color: rgb(136, 136, 136);">----------------------------------------------------------------------------------------------</span></p><p class="ql-align-right"><br></p><p class="ql-align-center"><br></p><h4 class="ql-align-center"><strong><u>Exames Complementares</u></strong></h4><p class="ql-align-center"><br></p><p>Paciente:<span style="color: rgb(0, 0, 0); background-color: transparent;">&nbsp;</span><strong style="color: rgb(0, 0, 0); background-color: transparent;">Marly Josefina</strong></p><p><br></p><p class="ql-align-right"><br></p><p class="ql-align-right"><br></p><p class="ql-align-right"><br></p><h3 class="ql-align-justify"><strong>Solicito:</strong>	</h3><p class="ql-align-justify"><br></p><ul><li class="ql-align-justify">Hemograma completo</li><li class="ql-align-justify">Glicemia de jejum</li><li class="ql-align-justify">25 OAH vitamina D</li><li class="ql-align-justify">Vitamina B12</li><li class="ql-align-justify">Ureia </li><li class="ql-align-justify">Creatinina</li><li class="ql-align-justify">TSH</li><li class="ql-align-justify">T4 livre</li><li class="ql-align-justify">Sumário de urina</li><li class="ql-align-justify">Parasitológico de fezes 01 amostra</li></ul><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-indent-3 ql-align-justify"><br></p><p class="ql-indent-3 ql-align-justify"><br></p><p class="ql-indent-3 ql-align-justify"><br></p><p class="ql-indent-3 ql-align-justify"><br></p><p class="ql-indent-3 ql-align-justify"><br></p><p class="ql-align-justify"> 06 de 04 de 2023</p><p><br></p>', 18, 15, 0, 1680197396, 1680813629, 1),
	(35, 'Receita', 1, '<p class="ql-align-right"><img src="data:image/png;base64,"></p><p class="ql-align-right"><span style="color: rgb(136, 136, 136);">----------------------------------------------------------------------------------------------</span></p><p class="ql-align-right"><br></p><p class="ql-align-center"><br></p><h3 class="ql-align-center"><strong>Receita</strong></h3><p class="ql-align-center"><br></p><p><span class="ql-font-monospace">Paciente:</span><span style="background-color: transparent; color: rgb(0, 0, 0);" class="ql-font-monospace">&nbsp;</span><strong style="background-color: transparent; color: rgb(0, 0, 0);" class="ql-font-monospace">Marly Josefina</strong></p><p class="ql-align-center"><br></p><p class="ql-align-right"><br></p><p class="ql-align-justify"><span class="ql-font-monospace">- Pantoprazol 20mg ----------------------------------------------------------- 60cp\r\n  Tomar 1 comprimido em jejun diariamente por 60 dias.\r\n\r\n- Dipirona monoidratada 500mg ------------------------------------------------ 10cp\r\n  Tomar 1 comprimido de 8/8h.\r\n\r\n- Domperidona 30mg ----------------------------------------------------------- 28cp\r\n  Tomar 1 comprimido a cada 6h durante 8 dias.</span></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify"><span class="ql-font-monospace"> 06 de 04 de 2023</span></p><p><br></p>', 18, 15, 0, 1680813332, 1680815334, 1),
	(36, 'Atestado', 1, '<p class="ql-align-right"><img src="data:image/png;base64,"></p><p class="ql-align-right"><span style="color: rgb(136, 136, 136);">----------------------------------------------------------------------------------------------</span></p><p class="ql-align-right"><br></p><p class="ql-align-center"><br></p><p class="ql-align-center"><br></p><p class="ql-align-center"><u class="ql-size-large">Atestado</u></p><p class="ql-align-center"><br></p><p class="ql-align-right"><br></p><p class="ql-align-right"><br></p><p class="ql-align-right"><br></p><p class="ql-align-center"><br></p><p class="ql-align-center"><br></p><p class="ql-align-center"><br></p><p class="ql-align-justify">	Atestamos para os devidos fins, que o paciente Marly Josefina esteve em consulta no 06 pela tarde.</p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p><br></p><p class="ql-align-justify">&nbsp;06 de 04 de 2023</p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p>', 18, 15, 0, 1680815552, 1680815552, 1),
	(37, 'Receita', 1, '<p class="ql-align-right"><img src="data:image/png;base64,"></p><p class="ql-align-right"><span style="color: rgb(136, 136, 136);">----------------------------------------------------------------------------------------------</span></p><p class="ql-align-right"><br></p><p class="ql-align-center"><br></p><h3 class="ql-align-center"><strong>Receita</strong></h3><p class="ql-align-center"><br></p><p><span class="ql-font-monospace">Paciente:</span><span style="background-color: transparent; color: rgb(0, 0, 0);" class="ql-font-monospace">&nbsp;</span><strong style="background-color: transparent; color: rgb(0, 0, 0);" class="ql-font-monospace">Marly Josefina</strong></p><p class="ql-align-center"><br></p><p class="ql-align-right"><br></p><p class="ql-align-justify"><span class="ql-font-monospace">- Dipirona monoidratada 500mg ------------------------------------------------ 10cp\r\n  Tomar 1 comprimido de 8/8h.\r\n\r\n- Domperidona 30mg ----------------------------------------------------------- 28cp\r\n  Tomar 1 comprimido a cada 6h durante 8 dias.\r\n\r\n- Pantoprazol 20mg ----------------------------------------------------------- 60cp\r\n  Tomar 1 comprimido em jejun diariamente por 60 dias.</span></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify ql-indent-3"><br></p><p class="ql-align-justify"><span class="ql-font-monospace"> 06 de 04 de 2023</span></p><p><br></p>', 18, 15, 0, 1680815827, 1680816936, 1);

